using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;namespace UIKit{    /// <summary>    /// The UISearchController class defines an interface that manages the presentation of a search bar in concert with the search results controller’s content. The search results controller, a UIViewController object specified by the searchResultsController property, manages the results of the search.    /// </summary>    /// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/UIKit/Reference/UISearchController/index.html#//apple_ref/occ/cl/UISearchController"/>    [iOSVersion(8)]    public class UISearchController : UIViewController//, AnyObject, NSCoding, NSExtensionRequestHandling, NSObjectProtocol, UIAppearanceContainer, UIContentContainer, UIStateRestoring, UITraitEnvironment, UIViewControllerAnimatedTransitioning, UIViewControllerTransitioningDelegate    {        /// <summary>        /// Create a new search controller using a search results controller that determines where search results are displayed.        /// </summary>        /// <param name="searchResultsController">The UIViewController object that manages the search results.</param>        [iOSVersion(8)]        public UISearchController(UIViewController searchResultsController) { }                /// <summary>        /// The presented state of the search interface.        /// </summary>        [iOSVersion(8)]        [Export("active")]        public bool Active { get; set; }                /// <summary>        /// The search controller’s delegate.        /// </summary>        [iOSVersion(8)]        [Export("delegate")]        public UISearchControllerDelegate Delegate { get; set; }                /// <summary>        /// Determines whether the underlying content is dimmed during a search.        /// </summary>        [iOSVersion(8)]        [Export("dimsBackgroundDuringPresentation")]        public bool DimsBackgroundDuringPresentation { get; set; }                /// <summary>        /// Determines whether the navigation bar is hidden during searching.        /// </summary>        [iOSVersion(8)]        [Export("hidesNavigationBarDuringPresentation")]        public bool HidesNavigationBarDuringPresentation { get; set; }                /// <summary>        /// The search bar object used by the search controller. (read-only)        /// </summary>        [iOSVersion(8)]        [Export("searchBar")]        public UISearchBar SearchBar { get; private set; }                /// <summary>        /// The view controller that manages the results of the search. (read-only)        /// </summary>        [iOSVersion(8)]        [Export("searchResultsController")]        public UIViewController SearchResultsController { get; private set; }                /// <summary>        /// The object responsible for updating the contents of the search results controller.        /// </summary>        [iOSVersion(8)]        [Export("searchResultsUpdater")]        public UISearchResultsUpdating SearchResultsUpdater { get; set; }    }}